(2078, 'en', 'Take care, you evil and wrathful spirits. God may ordain that in swallowing you may choke to death.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2079, 'en', 'Perhaps you like to hear yourself talk, as the stork its own clattering.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2080, 'en', 'You are the cousins of the Antichrist.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2081, 'en', 'You are the sin-master and soul-murdered.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2082, 'en', 'Just as the devil is disorderly and jumbles things together, so your writings and head are equally disordered and mixed up, so that it is exceedingly annoying to read and difficult to remember what you write.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2083, 'en', 'Do you not see here the devil, the enemy of God\'s order?', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2084, 'en', 'You plunge in like a sow to devour pearls, and like a dog tearing holy things to pieces.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2085, 'en', 'In devil\'s fashion you go out where God would enter and enter where God goes out. It ought surprise no one that I call you a devil.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2086, 'en', 'Listen, murdered of souls and sinful spirit!', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2087, 'en', 'Stupid spirit.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2088, 'en', 'What light can there be in heads that hold such tangible darkness?', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2089, 'en', 'We may confidently suppose and be sure that your spirit will produce evidence and proof when the devil becomes God.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2090, 'en', 'The devil rides you.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2091, 'en', 'You have fought against us as one would attack a cliff with a broken straw.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2092, 'en', 'You have lost head, eyes, brain, and heart, since you know neither shame nor fear, and dare wager all according to your whims.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2093, 'en', 'If I were to repay you in slanderous words for the way you have blasphemed so maliciously and terribly, where would I find enough words? For your sins and blasphemy are immeasurable.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2094, 'en', 'I beg you put your glasses on your nose, or blow your nose a bit, to make your head lighter and the brain clearer.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2095, 'en', 'You do nothing more than latch on to a small word and smear over with your spittle as you please, but meanwhile you do not take into account other texts which overthrow you who smear and spits, so that you are up-ended with all four limbs in the air.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2096, 'en', 'You are like the ostrich, the foolish bird which thinks it is wholly concealed when it gets its neck under a branch. Or like small children, who hold their hands in front of their eyes and seeing nobody imagine that no one sees them either.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2097, 'en', 'The silly, feeble devil thinks no one sees it. No, my fellow, we see you well enough. You haven\'t used enough make-up; you need more and other colors.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2098, 'en', 'This is pure knavery with which the devil here deals. Tell me, you who are so pure, why are you here so filthy?', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2099, 'en', 'You ought to feel shame in your hearts, you great gruff asses\' heads.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2100, 'en', 'What a fine spirit we have here, who would drive out the devil by a devil. Indeed you would disgrace public truth with public lies.', '2018-10-20 20:14:33', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2101, 'en', 'Finally you cannot help yourself but spew out good, fat, strong lies, and like a mad person speak against yourself.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2102, 'en', 'Were you against the heathen Priapus, he would probably pass wind in the face of such well-aimed terror.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2103, 'en', 'How this spirit makes a food of itself in all its words. You can say nothing but that it boomerangs on your own head and hits you so that you not only are blackened but are made to stagger as a drunkard.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2104, 'en', 'See how your spirit here walks on eggs, how you twist and turn, how you talk as if you had mush in your mouth and mumble like a half-dead, despairing person.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2105, 'en', 'You like as an arch rascal and disgraceful scoundrel.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2106, 'en', 'You act and speak as a bride of the devil, expressing what the devil inspires. All blasphemous words of this kind are nothing but childish, mad, sacrilegious ideas, and lies which are not worthy of answer.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2107, 'en', 'You poor devil.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2108, 'en', 'You have surrendered yourself and dared to become an avowed enemy of God, wanting to race rather than trot to hell.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2109, 'en', 'Wither now, dear factious spirits? I will let you write and shriek for a thousand years and need not oppose you with more than one word. O how one word smashes you prophets and spirits into one lump in the gutter.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2110, 'en', 'There you are, like butter in sunshine.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2111, 'en', 'As far as I have been able to see and hear, you have no argument but high-sounding words of sacrilege. Everyone ought properly to shun and avoid you as messengers of none other than the devil.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2112, 'en', 'You are spiritual scarecrows and monk calves.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2113, 'en', 'What good purpose can you lazy, sluggish bullies accomplish?', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2114, 'en', 'You are poisonous, worthless gossips.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2115, 'en', 'You are undisciplined heads who out of utter perversity are able to do nothing in common or in agreement, but are different and self-centered in heart and life.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2116, 'en', 'You are like a herd of swine being invited to the table of a prince. You understand not such an honor, but only ravage what is set before you, even soiling the prince.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2117, 'en', 'What else can one say here, except that these ideas originate in your own wanton concoctions, or in a drunken dream?', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2118, 'en', 'You gamble with God\'s Word like a rogue.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2119, 'en', 'Heaven and earth are in danger of caving in because of your heresies.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2120, 'en', 'You are indeed cheated and deceived by falsehood, and that is what all like you deserve.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2121, 'en', 'You are not human beings, but empty shells and shadows.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2122, 'en', 'You dear asses.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2123, 'en', 'You are jugglers of imaginary sins.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2124, 'en', 'Even if your writings were from an angel from heaven I would take this horrible document, and, after having used it as toilet paper, wipe its nose.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2125, 'en', 'You are like swine who indiscriminately devour everything.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2126, 'en', 'You are emissaries of the devil.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2127, 'en', 'You are the true print and touch of the devil.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2128, 'en', 'What pig sties could compare in goings-on with you?', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2129, 'en', 'Whoever tolerates and listens to you should know that they are listening to the devil himself, incarnate and abominable, as he speaks out of the mouth of a possessed person.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2130, 'en', 'You are admirable, fine, pious sows and asses.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2131, 'en', 'You are like mouse-dropping in the pepper.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2132, 'en', 'Listen, you ass, you are a particularly crass ass, indeed, you are a filthy sow!', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2133, 'en', 'You are the white devil and a glittering Satan.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2134, 'en', 'You are pious and honest people, who cannot do anything but calumniate and lie.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2135, 'en', 'Snot-nose!', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2136, 'en', 'You should rightly be called lawyers for asses.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2137, 'en', 'Are you not mad, and crazy, and crass Nestorians, not knowing when you say yes and when you say no, stating one thing in the premise and another in the conclusion? Away with you stupid asses and fools!', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2138, 'en', 'You are a brothel-keeper and the devil\'s daughter in hell.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2139, 'en', 'You have set out to rub your scabby, scurvy head against honor.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2140, 'en', 'You curse, blaspheme, skriek, struggle, bellow, and spit, so that, if people really heard you utter words, they would gather with chains and bars, just as if you were possessed by a legion of devils and had to be seized and bound.', '2018-10-20 20:26:18', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service'),
(2141, 'en', 'Darwin\'s theory of survival of the fittest is shattered to bits by how fat you are.', '2018-10-21 16:34:21', 0, 'EIG Fan', 1, NULL),
(2142, 'en', 'I had not supposed or expected your arrogant spirit to seek such a ridiculous and childish reason for lying; you should have better reasons.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2143, 'en', 'Since you are such vulgar blockheads that you think such lewd and stupid gossip will harm me or bring you honor, you are the real Hanswursts - blockheads, boors, and dunderheads.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2144, 'en', 'Think what you will, so make in your pants, hang it round your neck, then make a jelly of it and eat it like the vulgar sows and asses you are!', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2145, 'en', 'You are the devil\'s donkey.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2146, 'en', 'This new thing you have devised is the vilest cesspool that the devil has on earth.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2147, 'en', 'May the devil stay with you in this blasphemous, murderous, sinful, pernicious thing.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2148, 'en', 'You sharp-eyed bats.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2149, 'en', 'You live like Epicureans and sows. So the fat is in the fire!', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2150, 'en', 'You no longer have, as you did several centuries ago, a cunning devil spurring you on, but a palpable blockhead, a crude devil, who in his malice can no longer disguise himself.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2151, 'en', 'You vulgar boor, blockhead, and lout, you ass to cap all asses, screaming your heehaws.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2152, 'en', 'For you are an excellent person, as skilful, clever, and versed in Holy Scripture as a cow in a walnut tree or a sow on a harp.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2153, 'en', 'A seven-year-old child, indeed, a silly fool, can figure it out on his fingers - although you, stupid ass, cannot understand anything.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2154, 'en', 'You, devil and Hanswurst, are in this matter a particularly silly wurst to lie so shamefully.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2155, 'en', 'You have the master-devil all right.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2156, 'en', 'Doctor Sow.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2157, 'en', 'God has punished you by making you incapable of understanding truth, virtue, or honor, thus handing you over to the devil to tell nothing but lies, indeed, to do all that is evil, and to upset all that is good.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2158, 'en', 'You poisonous loudmouth.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2159, 'en', 'You stink like devilish filth flung into Germany.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2160, 'en', 'I think that if you were alone in the field, an angry cat would be enough to scare you away.', '2018-10-21 16:34:21', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2161, 'en', 'Is not what I said before true, that you have eaten and drunk yourself full of devils, and so spew vainglorious devils out of your hellish gorge?', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2162, 'en', 'You wear a pair of cobweb trousers, like a man who, being naked, put on a new to hide his shame.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2163, 'en', 'You arch-assassin and bloodhound, the like of which has never been seen under the sun.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2164, 'en', 'There you are in the chains of divine judgment, bound in hell like all the devils.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2165, 'en', 'You pusillanimous scoundrel.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2166, 'en', 'You should not write a book before you have heard an old sow fart; and then you should open your jaws with awe, saying, \\\"Thank you, lovely nightingale, that is just the text for me!\\\"', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2167, 'en', 'I think that you would not be bold enough to blow at a farmer\'s fence if you knew that there was a flail behind the door; you would lift your heels in quite a manly way, as though it were snowing flails behind you.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2168, 'en', 'You abominable abomination.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2169, 'en', 'Your Hellishness.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2170, 'en', 'You are like a magician who conjures gulden into the mouths of silly people, but when they open their mouths they have horse dirt in them.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2171, 'en', 'The very devil himself would thank you for such an event, and no one but the miserable devil and his devilish scum would go there.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2172, 'en', 'You are the scum of all the scoundrels.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2173, 'en', 'You are an abominable arch-heretic.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2174, 'en', 'You are desperate, thorough arch-rascals, murderers, traitors, liars, the very scum of all the most evil people on earth. You are full of all the worst devils in hell - full, full, and so full that you can do nothing but vomit, throw, and blow out devils!', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2175, 'en', 'You are blasphemous, abominable rascals and damned scum of Satan.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2176, 'en', 'If you are furious, you can do something in your pants and hang it around your necks - that would be a musk apple and pacem for such gentle saints.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2177, 'en', 'You say, \\\"What comes out of our mouth must be kept!\\\" I hear it - which mouth do you mean? The one from which the farts come? (You can keep that yourself!)', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2178, 'en', 'You are a crude ass, and an ass you will remain!', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2179, 'en', 'Everyone can see that such a sentence must have been blown into you by all the existing devils with one breath.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2180, 'en', 'You are the founder and master of all sins.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/');
INSERT INTO `insults` (`number`, `language`, `insult`, `created`, `shown`, `createdby`, `active`, `comment`) VALUES
(2181, 'en', 'You roar as one possessed and full of devils.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2182, 'en', 'Yes, what happened to you is what must happen when one paints the devil above the door and asks him to be godfather.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2183, 'en', 'Dear God, what an utterly shameless, blasphemous lying-mouth you are!', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2184, 'en', 'You are such outrageous, shameless blockheads.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2185, 'en', 'You are a little pious prancer.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2186, 'en', 'You loathsome, accursed, atrocious monster.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2187, 'en', 'Why would anyone tolerate such things from someone like you, a rotten paunch, crude ass and fart-ass?', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2188, 'en', 'You are the worst rascal of all the rascals on earth!', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2189, 'en', 'I can with good conscience consider you a fart-ass and an enemy of God.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2190, 'en', 'I was frightened and thought I was dreaming, it was such a thunderclap, such a great horrid fart did you let go here! You certainly pressed with great might to let out such a thunderous fart - it is a wonder that it did not tear your hole and belly apart!', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
(2191, 'en', 'May God punish you, I say, you shameless, barefaced liar, devil\'s mouthpiece, who dares to spit out, before God, before all the angels, before the dear sun, before all the world, your devil\'s filth.', '2018-10-21 16:46:04', 0, 'Martin Luther', 1, 'https://github.com/stechstudio/insult-service/'),
